import React from 'react';
import './LoggedIn.css';

const LoggedIn = () =>{
    return(
        <div>
            <ul className="header">
                <li className="headerItem" >Current Inventory</li>
                <li className="headerItem" >Profile</li>
            </ul>

            <ul className='itemArea'>
                <ul className='itemSelector'>
                    <ul className='itemTab'>All Inventory</ul>
                    <ul className='itemTab'>Search</ul>
                </ul>

                <li className="item"><img src='.//resources/r1'/>Hello</li>
                <li className="item">Hello</li>
                <li className="item">Hello</li>
            </ul>
    
        </div>
    );
}

export default LoggedIn;
